('3','1','1','Vêtements','<p>Retrouvez nos coups de cœur mode, une sélection de pièces tendances à intégrer à votre garde-robe. Composez un style unique qui vous ressemble.</p>','vetements',NULL,NULL,NULL),
('3','1','2','Clothes','<p>Discover our favorites fashionable discoveries, a selection of cool items to integrate in your wardrobe. Compose a unique style with personality which matches your own.</p>','clothes',NULL,NULL,NULL),
('4','1','1','Hommes','<p>T-shirts, pulls, sweats à capuche et accessoires pour hommes. Des basiques et des créations originales pour tous les styles. </p>','hommes',NULL,NULL,NULL),
('4','1','2','Men','<p>T-shirts, sweaters, hoodies and men\'s accessories. From basics to original creations, for every style. </p>','men',NULL,NULL,NULL),
('5','1','1','Femmes','<p>T-shirts, pulls, sweats à capuche et accessoires pour femmes. Des basiques et des créations originales pour tous les styles. </p>','femmes',NULL,NULL,NULL),
('5','1','2','Women','<p>T-shirts, sweaters, hoodies and women\'s accessories. From basics to original creations, for every style. </p>','women',NULL,NULL,NULL),
('6','1','1','Accessoires','<p>Des objets et accessoires pour le bureau, la cuisine ou le salon. Faites de votre intérieur un espace qui vous ressemble.</p>','accessoires',NULL,NULL,NULL),
('6','1','2','Accessories','<p>Items and accessories for your desk, kitchen or living room. Make your house a home with our eye-catching designs. </p>','accessories',NULL,NULL,NULL),
('7','1','1','Papeterie','<p>Carnets, agendas, accessoires de bureau et plus encore. Tout ce dont vous avez besoin pour joindre l\'utile à l\'agréable, au travail ou à la maison.</p>','papeterie',NULL,NULL,NULL),
('7','1','2','Stationery','<p>Notebooks, agendas, office accessories and more. Everything you need to combine the pleasant and the useful, either at work or at home. </p>','stationery',NULL,NULL,NULL),
('8','1','1','Accessoires de maison','<p>Vous avez le sens du détail ? Agrémentez votre intérieur avec notre sélection d\'accessoires de maison.</p>','accessoires-de-maison',NULL,NULL,NULL),
('8','1','2','Home Accessories','<p>Details matter! Liven up your interior with our selection of home accessories. </p>','home-accessories',NULL,NULL,NULL),
('9','1','1','Art','<p>Affiches encadrées et images vectorielles, tout ce dont vous avez besoin pour donner de la personnalité à vos murs ou donner vie à vos projets créatifs.</p>','art',NULL,NULL,NULL),
('9','1','2','Art','<p>Framed poster and vector images, all you need to give personality to your walls or bring your creative projects to life.</p>','art',NULL,NULL,NULL);
