INSERT INTO `PREFIX_manufacturer_lang` VALUES
('1','1','<p>Studio Design propose une gamme de produits variée : prêt-à-porter, objets de décoration, accessoires de maison... Depuis sa création en 2012, la marque apporte des idées et des tendances nouvelles à travers ses collections. </p>',NULL,NULL,NULL,NULL),
