INSERT INTO `PREFIX_product_lang` VALUES
('1','1','1','<div id=\"description\">\r\n<h4 class=\"title-info-product\">Description</h4>\r\n<p class=\"description-block\">Pyjama tout doux pour bébé et on adore les lingettes réutilisables ! <br /><br />- Pyjama en velours <br />- Manches longues <br />- Col rond <br />- Ouverture par pressions au dos <br />- Avec pieds <br />- Imprimé \'dinosaure\' devant <br />- 2 cotons réutilisables <br />- 1 côté en velours et 1 côté en éponge</p>\r\n<br />\r\n<p>Référence: YP146 <button class=\"descriptionSizeGuide\">Guides des tailles</button></p>\r\n</div>\r\n<div id=\"product-composition\">\r\n<h4>Composition et entretien</h4>\r\n<p class=\"product-composition-title\">DORS BIEN : Dessus 81% COTON, 19% POLYESTER LINGETTE : Doublure 100% COTON, Dessus 81% COTON, 19% POLYESTER</p>\r\n<div class=\"blockEntretien\"><i class=\"logo_entretien_1\"></i> <i class=\"logo_entretien_2\"></i> <i class=\"logo_entretien_3\"></i> <i class=\"logo_entretien_4\"></i> <i class=\"logo_entretien_5\"></i> <i class=\"logo_entretien_6\"></i></div>\r\n</div>','<p>Coupe classique, col rond, manches courtes. T-shirt en coton pima extra-fin à fibres longues.</p>','hummingbird-printed-t-shirt',NULL,NULL,NULL,'T-shirt imprimé colibri',NULL,NULL,NULL,NULL),
('1','1','2','<p>Symbol of lightness and delicacy, the hummingbird evokes curiosity and joy. Studio Design\' PolyFaune collection features classic products with colorful patterns, inspired by the traditional japanese origamis. To wear with a chino or jeans. The sublimation textile printing process provides an exceptional color rendering and a color, guaranteed overtime.</p>','<p>Regular fit, round neckline, short sleeves. Made of extra long staple pima cotton.</p>\r\n<p></p>','hummingbird-printed-t-shirt',NULL,NULL,NULL,'Hummingbird printed t-shirt',NULL,NULL,NULL,NULL),
('2','1','1','<p>La collection PolyFaune de la marque Studio Design propose des pièces aux coupes basiques et aux visuels colorés inspirés des origamis japonais traditionnels. À porter avec un chino ou un jean. Le procédé d\'impression par sublimation garantit la qualité et la longévité des couleurs.</p>','<p>Coupe classique, col rond, manches longues. Pull 100% coton avec intérieur brossé pour plus de confort. </p>','brown-bear-printed-sweater',NULL,NULL,NULL,'Pull imprimé colibri',NULL,NULL,NULL,NULL),
('2','1','2','<p>Studio Design\' PolyFaune collection features classic products with colorful patterns, inspired by the traditional japanese origamis. To wear with a chino or jeans. The sublimation textile printing process provides an exceptional color rendering and a color, guaranteed overtime.</p>','<p>Regular fit, round neckline, long sleeves. 100% cotton, brushed inner side for extra comfort. </p>','brown-bear-printed-sweater',NULL,NULL,NULL,'Hummingbird printed sweater',NULL,NULL,NULL,NULL),
('3','1','1','<p>Le meilleur reste à venir ! Faites parler vos murs avec cette affiche encadrée chargée d\'optimisme sera du plus bel effet dans un bureau ou un open-space. Cadre en bois peint avec passe-partout integré pour un effet de profondeur.</p>','<p>Affiche imprimée sur papier rigide, finition mate et surface lisse.</p>','affiche-encadree-the-best-is-yet-to-come',NULL,NULL,NULL,'Affiche encadrée The best is yet to come',NULL,NULL,NULL,NULL),
('3','1','2','<p>The best is yet to come! Give your walls a voice with a framed poster. This aesthethic, optimistic poster will look great in your desk or in an open-space office. Painted wooden frame with passe-partout for more depth.</p>','<p>Printed on rigid matt paper and smooth surface.</p>','the-best-is-yet-to-come-framed-poster',NULL,NULL,NULL,'The best is yet to come\' Framed poster',NULL,NULL,NULL,NULL),
('4','1','1','<p>Le meilleur reste à venir ! Faites parler vos murs avec cette affiche encadrée chargée d\'optimisme sera du plus bel effet dans un bureau ou un open-space. Cadre en bois peint avec passe-partout integré pour un effet de profondeur.</p>','<p>Affiche imprimée sur papier rigide, finition mate et surface lisse.</p>','affiche-encadree-the-adventure-begins',NULL,NULL,NULL,'Affiche encadrée The adventure begins',NULL,NULL,NULL,NULL),
('4','1','2','<p>The best is yet to come! Give your walls a voice with a framed poster. This aesthethic, optimistic poster will look great in your desk or in an open-space office. Painted wooden frame with passe-partout for more depth.</p>','<p>Printed on rigid matt finish and smooth surface.</p>','the-adventure-begins-framed-poster',NULL,NULL,NULL,'The adventure begins Framed poster',NULL,NULL,NULL,NULL),
('5','1','1','<p>Le meilleur reste à venir ! Faites parler vos murs avec cette affiche encadrée chargée d\'optimisme sera du plus bel effet dans un bureau ou un open-space. Cadre en bois peint avec passe-partout integré pour un effet de profondeur.</p>','<p>Affiche imprimée sur papier rigide, finition mate et surface lisse.</p>','affiche-encadree-today-is-a-good-day',NULL,NULL,NULL,'Affiche encadrée Today is a good day',NULL,NULL,NULL,NULL),
('5','1','2','<p>The best is yet to come! Give your walls a voice with a framed poster. This aesthethic, optimistic poster will look great in your desk or in an open-space office. Painted wooden frame with passe-partout for more depth.</p>','<p>Printed on rigid paper with matt finish and smooth surface.</p>','today-is-a-good-day-framed-poster',NULL,NULL,NULL,'Today is a good day Framed poster',NULL,NULL,NULL,NULL),
('6','1','1','<p>Le meilleur reste à venir ! Commencez la journée avec une pensée positive. Diamètre : 8,2cm / Hauteur : 9,5cm / Poids : 0.43kg. Passe au lave-vaisselle.</p>','<p>Mug en céramique blanche, 325ml.</p>','mug-the-best-is-yet-to-come',NULL,NULL,NULL,'Mug The best is yet to come',NULL,NULL,NULL,NULL),
('6','1','2','<p>The best is yet to come! Start the day off right with a positive thought. 8,2cm diameter / 9,5cm height / 0.43kg. Dishwasher-proof.</p>','<p>White Ceramic Mug, 325ml.</p>','mug-the-best-is-yet-to-come',NULL,NULL,NULL,'Mug The best is yet to come',NULL,NULL,NULL,NULL),
('7','1','1','<p>L\'aventure commence avec une tasse de café. Partez à la conquête de votre journée ! Diamètre : 8,2cm / Hauteur : 9,5cm / Poids : 0.43kg. Passe au lave-vaisselle.</p>','<p>Mug en céramique blanche. 325ml</p>','mug-the-adventure-begins',NULL,NULL,NULL,'Mug The adventure begins',NULL,NULL,NULL,NULL),
('7','1','2','<p>The adventure begins with a cup of coffee. Set out to conquer the day! 8,2cm diameter / 9,5cm height / 0.43kg. Dishwasher-proof.</p>','<p>White Ceramic Mug. 325ml</p>','mug-the-adventure-begins',NULL,NULL,NULL,'Mug The adventure begins',NULL,NULL,NULL,NULL),
('8','1','1','<p>Ajoutez un nuage d\'optimisme à votre café et démarrez la journée du bon pied, même les jours de réveil difficile ! Diamètre : 8,2cm / Hauteur : 9,5cm / Poids : 0.43kg. Passe au lave-vaisselle.</p>','<p>Mug en céramique blanche. 325ml</p>','mug-today-is-a-good-day',NULL,NULL,NULL,'Mug Today is a good day',NULL,NULL,NULL,NULL),
('8','1','2','<p>Add an optimistic touch to your morning coffee and start the day in a good mood! 8,2cm diameter / 9,5cm height / 0.43kg. Dishwasher-proof.</p>','<p>White Ceramic Mug. 325ml</p>','mug-today-is-a-good-day',NULL,NULL,NULL,'Mug Today is a good day',NULL,NULL,NULL,NULL),
('9','1','1','<p>Ce coussin imprimé renard ajoutera une touche graphique et colorée à votre canapé, fauteuil ou lit. Optez pour une déco moderne et zen qui invite à la relaxation. Housse 100% coton lavable en machine à 60° / Intérieur 100% polyester hypoallergénique. </p>','<p>Coussin déhoussable avec zip invisible au dos. 32x32cm</p>','coussin-renard',NULL,NULL,NULL,'Coussin renard',NULL,NULL,NULL,NULL),
('9','1','2','<p>The mountain fox cushion will add a graphic and colorful touch to your sofa, armchair or bed. Create a modern and zen atmosphere that inspires relaxation. Cover 100% cotton, machine washable at 60° / Filling 100% hypoallergenic polyester.</p>','<p>Cushion with removable cover and invisible zip on the back. 32x32cm</p>','mountain-fox-cushion',NULL,NULL,NULL,'Mountain fox cushion',NULL,NULL,NULL,NULL),
('10','1','1','<p>Ce coussin imprimé ours brun ajoutera une touche graphique et colorée à votre canapé, fauteuil ou lit. Optez pour une déco moderne et zen qui invite à la relaxation. Housse 100% coton lavable en machine à 60° / Intérieur 100% polyester hypoallergénique. </p>','<p>Coussin déhoussable avec zip invisible au dos. 32x32cm</p>','coussin-ours-brun',NULL,NULL,NULL,'Coussin ours brun',NULL,NULL,NULL,NULL),
